import React, { useState } from "react";
import BooStrap from "./Header";
import "./../../css/header.css";

export default function Index() {
  const [show, setShow] = useState(false);
  const ShowState = () => {
    setShow(true);
  };
  const Ul = () => {
    return (
      <ul>
        <li>ควิซโชว์</li>
        <li>ชิดคอม</li>
        <li>ซีรี่ส์ต่างประเทศ</li>
        <li>ทอล์คโชว์</li>
        <li>ประกวดร้องเพลง</li>
        <li>ละคร</li>
        <li>วาไรตี้</li>
        <li>เกมโชว์</li>
        <li>เรียลลิตี้โชว์</li>
      </ul>
    );
  };
  return (
    <div className="container-box">
      <nav className="nav">
        <div className="logo">
          <img src="/img/logo-wptv.png" alt="" />
          <div className="icon">
            <i className="fas fa-search"></i>
          </div>
        </div>
        <div className="menubar">
          <ul>
            <li>รายการสด </li>
            <li onMouseOver={ShowState}>
              รายการ <i className="fas fa-sort-down i"></i>
              
            </li>
            <li>ผังรายการ</li>
            <li>ศิลปินดารา</li>
            <li>เพลง</li>
            <li>ข่าวประชาสัมพันธ์</li>
            <li>workpointTODAY</li>
          </ul>
        </div>
      </nav>
      <BooStrap />
      <script src="./../"></script>
    </div>
  );
}
